INSERT INTO text_object (id, language, text, type, id_characters_comics) VALUES (1, 'en-us', 'Join 3-D MAN, CLOUD 9, KOMODO, HARDBALL, and heroes around America in the battle that will decide the fate of the planet and the future of the Initiative program. Will the Kill Krew Army win the day?', 'issue_preview_text', 1);
INSERT INTO text_object (id, language, text, type, id_characters_comics) VALUES (2, 'en-us', 'SECRET INVASION Tie-In! <br>"V-S DAY" <br>It''s been leading to this since the Hank Pym Skrull first came up with the idea for a Fifty State Initiative. This is the final assault in the Secret Invasion, a nation-wide plan that will test the limits of 3-D MAN''S superhuman militia, THE KILL KREW ARMY! Join 3-D MAN, CLOUD 9, KOMODO, HARDBALL, and heroes around America in the battle that will decide the fate of the planet and the future of the Initiative program. Win or lose, there''s no turning back. After today, everything changes. <br>Rated T+ ...$2.99 <br>', 'issue_solicit_text', 1);
